import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './Pages/Home';

function App() {
  return (
    <Router>
      <nav>

        <div class="nav-row">
          <h1 class="logo-h1">Property Listings</h1>

          <div>
            <div>
              <input class="main-search-input" placeholder="Search" />
            </div>
          </div>


          <div>
            <div class="nav-rows">
              <p>Login/Sign Up</p>
              <p>Bell</p>
            </div>
          </div>
        </div>
      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
